import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import FormDesigner from './FormDesigner';
import DesignedForm from './DesignedForm'
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" exact component={FormDesigner} />
       
      </div>
    </Router>
  );
}

export default App;
